insert into `article` values ('1','最美“志愿红”长圳社区军属助力疫情，防控共筑安全屏障','社区','468','0','2023-03-31 21:54:52.0','2023-03-31 21:54:52.0',null,null,null,'<p>“请您先打开健康码，扫描粤核酸4小程序二维码，填写登记资料”“老人小孩孕妇，请走绿色通道！”……连日来，玉塘街道长圳社区志愿者们响应号召、积极行动，在核酸检测现场维持秩序并指引群众进行检测，默默坚守在防控最前线。曾锦芳义工就是其中一名防疫志愿者。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/158/w1918h1440/20220304/6308-f2024a213ac6d9c2a580df8e06763b20.png"></p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/160/w1920h1440/20220304/2731-a5f25530a93b1a1e5801fdcd762b244f.png"></p><p>据了解，曾锦芳儿子去年应征入伍当兵，在儿子建议下，曾锦芳加入到社区志愿者行列。自成为一名义工以来，她积极参加社区环境清洁、新冠肺炎疫苗接种、交通文明劝导、七样重点人群和核酸检测等大大小小的志愿服务活动，曾荣获玉塘街道“疫情防控标兵”“长圳社区优秀志愿者”等称号。防疫期间，她不仅积极参加一线防疫服务，休息的时候还煮好凉茶，亲自送给一线防疫工作人员饮用降火。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/160/w1920h1440/20220304/06cc-b251cb0060532ddadc8b8c5ac8e2c23b.png"></p><p class="ql-align-center"><br></p><p><br></p><p>今年新年春节期间，曾锦芳义工再次逆流而上，挺身而出，积极参与社区疫情防控工作。她每天穿梭在核酸检测点人流当中，维持现场秩序、为居民答疑解惑、耐心指导群众申报信息、填写资料、点亮绿码，和大家并肩作战。社区相关负责人在一次和曾锦芳的交谈中得知，她因年轻时工作辛苦，腰部长时间劳损导致腰正骨断裂，不得不在腰部安装双钢板固定。今年春节期间因天气寒冷，她感觉腰部不适，在简单就医后又继续坚持参与疫情防控志愿服务。面对大家的关心与称赞，曾锦芳说：“因为我心中有信念，那就是守住自己的家园，希望能尽自己微薄的力量，协助社区防疫，真正帮助到居民”。</p><p class="ql-align-center">编辑 刘思凡&nbsp;审核 麦苗茵</p>','/api/upload/1567083128646795265.jpg',null);
insert into `article` values ('2','务庄社区幸福院 | “党建引领，服务到家”之便民服务活动','社区','806','0','2023-03-31 21:54:52.0','2023-03-31 21:54:52.0',null,null,null,'<p>为提升务庄社区幸福院的服务覆盖率，给长者日常生活提供便利，2022年10月12日上午，在务庄社区党委和务庄新时代文明实践站的指导和支持下，务庄社区幸福院链接了佛山华厦眼科医院、有剪发技能的长者潘池发、佛山金子口腔医院、务庄卫生站在务庄社区穗丰村祠堂开展便民服务活动，活动共吸引了73名穗丰村的长者参与。</p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>活动现场设有幸福院宣传摊位、眼科义诊、血压监测、防诈骗宣传、义剪摊位、耳科义诊。多元的摊位服务供到场长者按需选择,长者们踊跃参与其中，他们在社工的细心指引下，有序地排队参加各个摊位活动，每个摊位都深受长者的喜爱。</p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>到场的医生们尽职尽责地向长者进行眼力测试检查和耳科检查，并为每一位长者提出详尽的建议。在眼科义诊摊位，从长者的热情程度可以看出，许多长者对于眼睛健康方面比较重视。通过现场的访问了解到有部分长者因为害怕做手术而拒绝到医院做正规的检查治疗，眼科医生提醒大家，眼部有不适的症状尽量不要自己去药房买药，需要去有资质的正规医院做进一步检查和处理。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>卫生站的医生仔细地为长者们测量血压和测量血糖，耐心地向长者们讲解血压管理注意事项，并提醒长者们日常要多注意饮食。在理发摊位前，义剪师傅仔细听取每位长者的理发需要，然后用精湛娴熟的手艺，赢得了长者们的赞誉。黄姨称赞义剪师傅非常有耐心，而且剪得很好看很满意。</p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><br></p><p><br></p><p>参加活动的吴姨说：“幸福院的便民服务活动真的很好，我最喜欢义诊服务，让我们在村子就可以有医生进行义诊，方便了我们的生活”。在幸福院宣传摊位中，社工向长者们派发幸福院的宣传单，为长者宣传幸福院的活动。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>务庄社区幸福院的便民服务一直以来得到了长者们的一致好评，在家门口就为社区长者提供了实实在在、贴近民心、便民利民的服务。务庄社区幸福院也将坚持为长者服务的理念，继续链接社区资源为长者提供更加优质的便民服务，携手共建美丽和谐的家园。</p>','/api/upload/1582280108566118400.jpg','务庄社区幸福院');
insert into `article` values ('3','“志愿一抹红，我是巡路人”龙田社区开展交通劝导文明志愿活动','社区','940','0','2023-03-31 21:54:52.0','2023-03-31 21:54:52.0',null,null,null,'<p>为了充分发挥社区志愿者服务热情，在龙田社区党委支持下，龙田社区党群服务中心于3月2日上午开展了“志愿一抹红，我是巡路人”龙田社区交通劝导文明志愿活动。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/290/w1080h810/20220304/4dfd-5da09336a9d2d85e18ff17c4b6293f32.jpg"></p><p>由于疫情实施频发，志愿者们都投身于核酸检测志愿服务中。3月伊始，巡路人志愿服务活动正式开启了新一年新征程。志愿者们久违整齐穿上了红马甲，精神抖擞地站在交通路口对来往行人、电瓶车车辆进行交通文明劝导。在红马甲的效应下，行人和车辆井然有序。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/290/w1080h810/20220304/0a3f-330f5fa7f150c437036a440e9eeed034.jpg"></p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/290/w1080h810/20220304/0a7f-3d74e7a13f3bc056b59930764f5561ab.jpg"></p><p class="ql-align-center"><br></p><p><br></p><p>据悉，龙田社区将定期组织志愿者开展交通文明劝导志愿服务、环保志愿服务以及核酸检测志愿服务等常规志愿服务活动，为社区治理建设贡献志愿红的力量。</p><p>（来源：龙田社区党群服务中心）</p><p>编辑 李依林&nbsp;审核 麦苗茵</p><p>（作者：李辉蓝)</p>','/api/upload/1567083897945063424.jpg',null);
insert into `article` values ('4',' 我为群众办实事— “情暖重阳心连心”入户探访活动','社区','681','0','2023-03-31 21:54:52.0','2023-03-31 21:54:52.0',null,null,null,'<p>为了更好掌握辖区内老人的生活状况，同时在重阳过后，气温急剧转变的形势下，老年人群体的需求应受到密切关注与及时回应，了解社区高龄长者居家需求与生活困难。10月12日上午，红星社区、红星社区幸福院组织热心长者志愿者入户探访社区12名高龄、独居老人。</p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>潘奶奶看到社工和志愿者们的到来，表示十分地高兴，热情地招待我们坐下聊家常。志愿者帮助其做家务，提醒其注意食品安全，不要吃隔夜菜。同时天气降温提醒长者们注意防寒保暖，希望他们保重身体，保持乐观开朗的心态，健康积极快乐地过好每一天。</p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p><br></p><p><br></p><p>此外社工和志愿者们还利用上门探访的机会，检查了老人家中的卫生和安全设施情况。提醒雷奶奶，居住的环境，会影响到健康和安全。尤其是眼睛看不清，更要注意。</p><p><br></p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p><br></p><p>通过此次走访，进一步了解了红星社区内高龄长者的生活和需要，也让他们真真切切感受到红星社区大家庭的温暖。今后，红星社区幸福院会继续把为孤寡、高龄老人解决实际困难当作头等大事来做，关注社区弱势群体，使社区形成“爱老、敬老、助老”的良好氛围，为构建美好红星家园打下基础。</p>','/api/upload/1582281276935634945.jpg',' 我为群众办实事');
insert into `article` values ('5','口岸社区疫情防控中的一个个暖心故事....','社区','508','0','2023-03-31 21:54:52.0','2023-03-31 21:54:52.0',null,null,null,'<p><strong>“做好自我防护，平安归队！”</strong></p><p>口岸社区党委书记肖锦威对即将到封控区和管控区开展数据核查、全员核酸检测、后勤保障等工作的街道下沉人员、社区工作人员作行动前最后一次部署，强调防疫任务和防控一线的责任和使命、要求做细做实大数据排查，不漏一户不漏一人。肖锦威为队员们整理防护服，确保防护到位，叮嘱道：“大家一定要做好自我防护，保障自身安全，平安归队！”</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/388/w770h418/20220304/61b9-c5b47dbc6c7feaaf09f01230cdf01a6e.png"></p><p>行动前再部署。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/208/w432h576/20220304/5e10-3deab031f08e24fa915c2e3f934c67be.png"></p><p>肖锦威为队员们整理防护服。</p><p><strong>奋战到凌晨，社区专职工作者发挥着光和热</strong></p><p>根据疫情防控工作需要，口岸社区在封控、管控区设临时指挥部、党支部，并设立围合管理组、核酸采样组、物资保障组、安保组等小组，全力织密筑牢疫情防控网，全力保障居民群众正常生活。封控管控区并不大，但工作人员的微信步数平均每日都在2万步以上。防疫任务加重，连续9天的全员核酸检测、专项数据核查、流调信息核查、密接次密接人员管理……社区专职工作者每天超负荷奋战到凌晨，却步履不停、从不退缩，大家都拧成一股绳，各尽其责，全力做好防疫和居民服务。口岸社区还设立24小时热线，按楼栋建立微信群，为隔离人员答疑解惑，及时了解他们的需求，针对性做好个性化服务。社区民政专干金莉自抗疫工作以来，已经一个多星期未归家。当其爱人得知社区缺人手，第一时间便挺身而出，用实际行动舍小家、保大家，抗疫“夫妻档”并肩作战，并表示：“我的妻子奋斗在抗疫一线，我也要用行动来支持她，给孩子树立好榜样。”</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/406/w689h517/20220304/2108-63119014f7fc121a18e39741ca226f62.png"></p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/410/w691h519/20220304/f065-65f313d256b15702a7c623dba6fa5b75.png"></p><p>社区工作人员彻夜核查数据。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/418/w696h522/20220304/3867-849ab492e3b43ac2216f76ca769e6c9c.png"></p><p>抗疫“夫妻档”并肩作战。</p><p><strong>蜜蜂小分队，哪里需要搬哪里</strong></p><p>由天健小学10名教师组成的蜜蜂小分队，化身为跑腿人和快递员，全力做好封控管控区居民快递和外卖配送工作，大大减轻小区物业压力，以便更好地应对居民各种突发状况，齐心解决居民难题。教师们“三尺讲台”与抗疫一线无缝切换，在围合卡口代收快递，按小区分拣快递，再搬运至各个小区门口，由物业再次派送至各楼各户。在快递分拣区域内，蜜蜂小分队身着隔离衣穿梭在一件又一件快递之间，成为了口岸社区管控区一道靓丽的风景线。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/406/w689h517/20220304/52eb-733819522dc48c6e3eed62e95fc62b5e.png"></p><p>由天健小学10名教师组成的蜜蜂小分队。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/406/w689h517/20220304/b07e-2e07e3c53db377667a634bb820cce9ef.png"></p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/362/w664h498/20220304/aa0c-0b00fa178141dc1d9aabd30aeb47edcc.png"></p><p>蜜蜂小分队不分黑夜白昼分拣快递。</p><p><strong>红星志愿服务队，永葆军人本色</strong></p><p>面对突如其来的疫情，口岸社区退役军人红星志愿服务队响应号召，挺身而出，积极参与防范区核酸检测工作。他们在现场维持秩序、测量体温查验双码等，使得核酸检测工作有条不紊地进行。退役军人志愿者们发扬军人优良传统和优秀作风，彰显了“若有战，召必回”的庄严承诺，为社区疫情防控献上自己的力量，让防疫一线“志愿红”成为一道流动的风景线，全力为防控工作筑起坚实的“红色堡垒”。退役军人红星志愿服务队队员曹阳，还特意为核酸检测点医护人员与社区工作人员送来自己做好的热腾腾的汤圆，在寒冷的夜晚暖人心脾。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/446/w712h534/20220304/cea0-54f8d5ee2e8d963360c7004096ebaa89.png"></p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/465/w723h542/20220304/244e-64012ebcc36cb3e78833ece3427df855.png"></p><p>红星志愿服务队开展核酸检测服务。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/374/w671h503/20220304/ffc4-b90c1d23a461ad5f45fdf61122dab394.png"></p><p class="ql-align-center"><br></p><p><br></p><p>曹阳为工作人员送来自己做的汤圆。</p><p>病毒无情，人间有爱，风雨同舟，携手战“疫”。口岸社区有序联动，与时间赛跑，与疫情较量，“硬”防疫和“暖”服务两手抓，全力保障封控管控区居民生命安全和正常生活，让居民放心也暖心。</p><p>编辑 李依林&nbsp;审核&nbsp;汪新林</p><p>（作者：深圳特区报记者 彭军 实习生 韩诗淇 通讯员 刘珊珊)</p>','/api/upload/1567082025670672385.jpg','近日，战疫号角吹响，口岸社区迅速启动疫情防控应急工作预案。福田街道下沉人员、口岸社区工作人员、辖区物业、医护人员、各行各业志愿者持续奋战最前沿，戮力同心守家园，一幕又一幕温暖动人的战“疫”画面不断在口岸社区上演。');
insert into `article` values ('6','为老人包水饺、义诊、济南七东社区开展志愿服务活动','社区','837','0','2023-03-31 21:54:52.0','2023-03-31 21:54:52.0',null,null,null,'<p class="ql-align-center">志愿学雷锋，行动暖民心。3月4日，济南市市中区七里山街道七东社区开展学雷锋志愿服务活动。志愿者与社区老人们一起包水饺，将爱心午餐送上门。同时进行义诊，关爱老年人的身体健康。“活动想到很周到，谢谢你们了。”现场，老人们纷纷为活动点赞。<img src="https://n.sinaimg.cn/sinakd20220304s/460/w720h540/20220304/c02c-997647ba1b1296168b6c2c82908898bc.jpg"></p><p class="ql-align-center">活动现场，中共济南市市中区委机构编制委员会机关党员“三服务”基层服务队正式成立，与社区志愿者们一起为老人送关爱、送服务。“不在于包多包少，包的好不好看，只要下厨了就是一份心意。”上午九点半，在七东社区内的和孚养老服务中心“老饭桌”，机关党员“三服务”基层服务队及社区志愿者们正为孤寡老人和残疾人包水饺。满满两大盆饺子馅，有肉有素，照顾到了不同老人的口味。揉面的、擀皮的、包饺子的……大家分工明确，相互配合，屋子里充满了欢声笑语。<img src="https://n.sinaimg.cn/sinakd20220304s/325/w720h405/20220304/c342-c0120d0494ac06ff2198b7e329665543.jpg"></p><p>很快饺子出锅了，中共济南市市中区委机构编制委员会办公室副书记姜建辉跟随志愿者们入户为独居、残疾的老人送去暖心的午餐。“饺子不在皮上，在馅上，谢谢你们总想着我。”周奶奶激动地握着志愿者的手说。“在雷锋日能参加这样的活动，帮助独居的老人很有意义。”社区志愿者说，恰逢二月二，在这个农历节日里希望包饺子能给社区的孤寡老人送上一份温暖。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/459/w720h539/20220304/9a15-8161a53530a110a69764de3e9445684c.jpg">与此同时，七东社区为辖区内的老人和残疾人免费义诊的活动也在有序进行，前来义诊的居民早早地排起了长队。医护人员现场为居民测血糖、量血压、查视力，针对每位居民的检查情况提出一对一的建议，耐心地叮嘱他们日常生活中的注意事项，并提出专业的就医指导，居民纷纷表示，活动很贴心。“他们服务态度很好，很贴心。”社区居民说。</p><p>“关爱老年人的眼健康，让老年人在家门口就能享受到眼科保健。”山东中医药大学附属眼科医院米蓓主任介绍道，现在老年人使用电子产品比较多，社区义诊能及时发现老年人的眼科问题，给他们做好解释，早发现早治疗。</p><p class="ql-align-center"><img src="https://n.sinaimg.cn/sinakd20220304s/325/w720h405/20220304/a294-03d7354b3a06755a9c0f3e484cdcf2c1.jpg">此外，在活动启动仪式上，七东社区综合党委书记王美华对社区工作进行了简要总结，中共济南市市中区委机构编制委员会办公室副书记姜建辉对编办“三服务”基层服务队的有关内容进行了详细的介绍。他指出，“三服务”的内容包括深化‘双报到’服务、机构编制政策基层服务、‘学雷锋’志愿服务，今天是农历二月二，明天又恰逢学雷锋纪念日，他们会以实际行动推进机关党建工作与业务工作的深度融合，打通党员服务群众、机关服务基层“最后一米”。</p><p><br></p>','/api/upload/1567084507134164992.jpg',' 志愿学雷锋，行动暖民心。');
